commits.content:
@tailwind base;
@tailwind components;
@tailwind utilities;
@import url('https://fonts.googleapis.com/css2?family=Comfortaa&family=Righteous&display=swap');
*{
    font-family: 'Righteous', cursive;
}
.primary-text{
    @apply text-zinc-800 
}
.primary-bg{
    @apply bg-zinc-800
}
.secondary-text{
    @apply text-zinc-100 
}
.secondary-bg{
    @apply bg-zinc-100
}
.header{
   @apply sticky primary-bg secondary-text h-12 flex justify-between items-center
}
.wrap{
    @apply mx-10 text-lg
}
.btn{
    @apply secondary-bg primary-text p-2 text-sm rounded
}
.btn:hover{
    @apply ring ring-2 ring-zinc-200 ring-offset-1 ring-offset-zinc-800
}
.btn:active{
@apply primary-bg secondary-text
}
.form
